    <div className="product-box product-box-I">
      {
         product.map((item, i) => {
           return (
            <div className="product-box-I-item">
              <img src="" />
              <div></div>
            </div>
           )
         })
      }
    </div>
   )
 }

 return productType1()
}

export default Products
